import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Button, Alert } from 'react-native';

export default function SessionDetails() {
    return (
    <View style={styles.container}>
        <Text style={styles.heading}>Session Details for Math</Text>
        <Text style={styles.heading2}>Begins at 2pm</Text>
        <StatusBar style="auto" />
    </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#33b5e5',
    },
    heading: {
        fontSize: 40,
        textAlign: 'left',
        color: '#000000',
        marginLeft: "10%",
        marginRight: "10%",
        marginTop: '20%',
    },
    heading2: {
        fontSize: 20,
        textAlign: 'left',
        color: '#000000',
        marginLeft: "10%",
        marginRight: "10%",
    },
});
